DefinicjaCeny.Metoda:
public void Przelicz_Eksportowa()
{
  ICena cena = Policz("Podstawowa");
  Netto  = cena.Netto*(Percent.Hundred + this.Narzut);
  Netto = Handel.Waluty.TabeleKursowe.NBP.Przelicz(Netto.RoundCy(), Date.Today, "EUR");
  Brutto = Netto*(Percent.Hundred+Towar.ProcentVAT);
  StandardowaIlosc = cena.StandardowaIlosc;
}

FeatureDefinition.Code:
public bool Get_Feature_Widocznosc_podrzednych_ZD( Soneta.Handel.RelacjeDokumentow.DefDokPodrzednego defDokPodrzednego ) 
{
	bool widocznosc = true;

	if (Row.DaneKontrahenta == null)
		return widocznosc;

  if (defDokPodrzednego.Podrzedna.Guid == new Guid("00000000-0011-0002-0007-000000000000"))      // ZK
			widocznosc = Row.DaneKontrahenta.RodzajPodmiotu != RodzajPodmiotu.Unijny &&
							     Row.DaneKontrahenta.RodzajPodmiotu != RodzajPodmiotu.UnijnyTrójstronny;

	else 
		if (defDokPodrzednego.Podrzedna.Guid == new Guid("00000000-0011-0002-0026-000000000000"))    // ZZAL
				widocznosc = Row.DaneKontrahenta.RodzajPodmiotu != RodzajPodmiotu.Unijny &&
							     Row.DaneKontrahenta.RodzajPodmiotu != RodzajPodmiotu.UnijnyTrójstronny;

		else 
			if (defDokPodrzednego.Podrzedna.Guid == new Guid("00000000-0011-0002-0030-000000000000"))   // ZKUE
					widocznosc = Row.DaneKontrahenta.RodzajPodmiotu == RodzajPodmiotu.Unijny ||
								   Row.DaneKontrahenta.RodzajPodmiotu == RodzajPodmiotu.UnijnyTrójstronny;

	return widocznosc;
}

