public bool Get_Feature_Widocznosc_podrzednych_PAR(Soneta.Handel.RelacjeDokumentow.DefDokPodrzednego defDokPodrzednego )
{
	bool widocznosc = true;

	if (Row.DaneKontrahenta == null)
		return widocznosc;

  if (defDokPodrzednego.Podrzedna.Guid == new Guid("00000000-0011-0002-0004-000000000000"))      // FVP
			widocznosc = string.IsNullOrEmpty(Row.DaneKontrahenta.EuVAT);

	else 
		if (defDokPodrzednego.Podrzedna.Guid == new Guid("00000000-0011-0002-006b-000000000000"))    // FVPP
			widocznosc = !string.IsNullOrEmpty(Row.DaneKontrahenta.EuVAT);

	return widocznosc;
}

// W kodzie możesz używać następujacych zmiennych:
// Row: DokumentHandlowy - Wiersz przeliczanej cechy
// Table: DokHandlowe - Tabela wiersza przeliczanej cechy
// Module: HandelModule - Moduł, w którym znajduje się tabela
// Session: Session - Obiekt sesji dający dostęp do wszystkich danych program

public bool Get_Feature_Widocznosc_TF( Soneta.Handel.RelacjeDokumentow.DefDokPodrzednego defDokPodrzednego )
{
	bool widocznosc = true;

  if (defDokPodrzednego.Podrzedna.Guid == new Guid("00000000-0011-0002-0060-000000000000"))      // TF
			widocznosc = Row.Suma.Brutto >= 200m && Row.Suma.VAT > 0;

	return widocznosc;
}

// W kodzie możesz używać następujacych zmiennych:
// Row: DokumentHandlowy - Wiersz przeliczanej cechy
// Table: DokHandlowe - Tabela wiersza przeliczanej cechy
// Module: HandelModule - Moduł, w którym znajduje się tabela
// Session: Session - Obiekt sesji dający dostęp do wszystkich danych programu

public EwidencjaSP Feature_ESP_wg_waluty 
{
    get 
		{
			EwidencjaSP esp = Row.EwidencjaSP;
			if (esp == null)
				return esp;

			KasaModule km = KasaModule.GetInstance(Row.Session);
			Waluta w = km.Waluty.Waluty.WgSymbolu[Row.Kwota.Symbol];			
			TypEwidencjiSP typesp = Row.SposobZaplaty.Odroczony ? TypEwidencjiSP.RachunekBankowy : TypEwidencjiSP.Kasa;

			OddzialFirmy oddzial = null;

			if (Row.Dokument is DokumentHandlowy)
			{
				var dh = (DokumentHandlowy)Row.Dokument;
				if (dh.Magazyn != null)      
					oddzial = dh.Magazyn.Oddzial;
			}
			else
				if (Row.Ewidencja != null)
					oddzial = Row.Ewidencja.Oddzial;


			// Jeśli ewidencja ustawiona na płatności nie zgadza się co do typu ze sposobem zapłaty, 
			// albo co do waluty z kwotą płatności, albo z dokumentem co do oddziału, szukamy właściwej

			if (esp.Blokada || esp.Typ != typesp || esp.Waluta != w || 
			    (oddzial != null && (esp.Oddzial == null || esp.Oddzial != oddzial)))
			{

				// Najpierw sprawdzamy, czy źródłowy dokument jest przypisany do oddziału firmy,
				// jeśli tak, szukamy ewidencji wśród tych, które są przypisane do tego samego oddziału

        if (oddzial != null)
        {
           foreach (EwidencjaSP e in km.EwidencjeSP)
           {
            if (!e.Blokada && e.Oddzial == oddzial &&
                e.Typ == typesp && e.Domyslny &&
                e.Waluta == w)
                return e;
           }
           foreach (EwidencjaSP e in km.EwidencjeSP)
           {
          	if (!e.Blokada && e.Oddzial == oddzial &&
                e.Typ == typesp &&
                e.Waluta == w)
                return e;
           }
        }		

				// Jeśli dokument nie jest przypisany do oddziału,
				// szukamy ewidencji bez przypisanego oddziału lub z przypisaną centralą

				foreach (EwidencjaSP e in km.EwidencjeSP)
				{
					if (!e.Blokada && (e.Oddzial == null || e.Oddzial.Centrala) &&
					    e.Typ == typesp && e.Waluta == w)
					{
						esp = e;
						break;
					}
				}
			}

			return esp;
    }
}

